import { CharCard } from "../CharCard";
import "../Characters/styles.css";

export const Characters = ({ character }) => {
  return (
    <div className="container-cards">
      {character.map((char) => (
        <CharCard key={char.id} character={char} />
      ))}
    </div>
  );
};
